import React from "react";
import {Redirect, Switch} from "react-router-dom";
import {ContentRoute} from "../../../_metronic/layout";
import BankList from "./bankSetup/BankList";
import BankCreate from "./bankSetup/BankCreate";
import BankBranchList from "./BankBranchList";
import BankAccountList from "./BankAccountList";
import BranchCreate from "./bankBranchSetup/BranchCreate";
import BankAccountCreate from "./bankAccountSetup/BankAccountCreate";
import DepartmentList from "./departmentSetup/DepartmentList";
import DepartmentCreate from "./departmentSetup/DepartmentCreate";
import StoreList from "./store/StoreList";
import StoreCreate from "./store/StoreCreate";
import UomList from "./uomSetup/UomList";
import UomCreate from "./uomSetup/UomCreate";
import PackSizeList from "./packSizeSetup/PackSizeList";
import PackSizeCreate from "./packSizeSetup/PackSizeCreate";
import DesignationList from "./designationSetup/DesignationList";
import DesignationCreate from "./designationSetup/DesignationCreate";
import CurrencyList from "./currencySetup/CurrencyList";
import CurrencyCreate from "./currencySetup/CurrencyCreate";
import ReportingManagerList from "./reportingManagerSetup/ReportingManagerList";
import ReportingManagerCreate from "./reportingManagerSetup/ReportingManagerCreate";
import LocationManagerList from "./locationManagerSetup/LocationManagerList";
import LocationManagerCreate from "./locationManagerSetup/LocationManagerCreate";
import DepotLocationLevelList from "./depotLocationLevelSetup/DepotLocationLevelList";
import DepotLocationLevelCreate from "./depotLocationLevelSetup/DepotLocationLevelCreate";

export default function MastarConfig() {
  return (
    <Switch>
      <Redirect
        exact={true}
        from="/mastar-config"
        to="/mastar-config/bank-setup"
      />

      <ContentRoute path="/mastar-config/bank-setup" component={BankList} />
      <ContentRoute from="/mastar-config/bank-setup-new" component={BankCreate} />

      <ContentRoute path="/mastar-config/bank-branch-setup" component={BankBranchList} />
      <ContentRoute from="/mastar-config/bank-branch-setup-new" component={BranchCreate} />

      <ContentRoute path="/mastar-config/bank-account-setup" component={BankAccountList} />
      <ContentRoute from="/mastar-config/bank-account-setup-new" component={BankAccountCreate} />

      <ContentRoute path="/mastar-config/department-setup" component={DepartmentList} />
      <ContentRoute from="/mastar-config/department-setup-new" component={DepartmentCreate} />

      <ContentRoute path="/mastar-config/store-setup" component={StoreList} />
      <ContentRoute from="/mastar-config/store-setup-new" component={StoreCreate} />

      <ContentRoute path="/mastar-config/uom-setup" component={UomList} />
      <ContentRoute from="/mastar-config/uom-setup-new" component={UomCreate} />

      <ContentRoute path="/mastar-config/pack-size-setup" component={PackSizeList} />
      <ContentRoute from="/mastar-config/pack-size-setup-new" component={PackSizeCreate} />

      <ContentRoute path="/mastar-config/designation-setup" component={DesignationList} />
      <ContentRoute from="/mastar-config/designation-setup-new" component={DesignationCreate} />

      <ContentRoute path="/mastar-config/currency-setup" component={CurrencyList} />
      <ContentRoute from="/mastar-config/currency-setup-new" component={CurrencyCreate} />

      <ContentRoute path="/mastar-config/reporting-manager-setup" component={ReportingManagerList} />
      <ContentRoute from="/mastar-config/reporting-manager-setup-new" component={ReportingManagerCreate} />

      <ContentRoute path="/mastar-config/location-manager-setup" component={LocationManagerList} />
      <ContentRoute from="/mastar-config/location-manager-setup-new" component={LocationManagerCreate} />
      <ContentRoute path="/mastar-config/depot-location-level-map-setup" component={DepotLocationLevelList} />
      <ContentRoute from="/mastar-config/depot-location-level-setup-map-new" component={DepotLocationLevelCreate} />
    </Switch>
  );
}
